CREATE TABLE User(
	id int NOT NULL AUTO_INCREMENT,
	email VARCHAR(40) PRIMARY KEY,
	password VARCHAR(40),
	userType VARCHAR(20),
	startDate DATE
)

CREATE TABLE Client(
	email VARCHAR(40) PRIMARY KEY REFERENCES User(email),
	username VARCHAR(50),
	name VARCHAR(50),
	gender VARCHAR(30),
	sexual_orientation VARCHAR(30),
	bio VARCHAR(500),
	description VARCHAR(50),
	likes VARCHAR(500),
	state VARCHAR(50),
	profilePicture VARCHAR(100),
	age int,
	birthday DATE,
	PRIMARY KEY (email)
	)
	
CREATE TABLE Business(
	email VARCHAR(30) REFERENCES User(email),
	name VARCHAR(40),
	address VARCHAR(150),
	description VARCHAR(500),
	businessType varchar(30),
	businessState varchar(20),
	PRIMARY KEY(email)	
)

CREATE TABLE Match(
	email1 VARCHAR(40) REFERENCES Client(email),	
	email2 VARCHAR(40) REFERENCES Client(email)
)

CREATE TABLE Promotion (
	id int NOT NULL AUTO_INCREMENT PRIMARY KEY,
	email VARCHAR(40) REFERENCES Business(email) ,
	title VARCHAR(100),
	description VARCHAR(500),
	promotionCode VARCHAR(15),
	imageId int
)

CREATE TABLE Subscription(
	id int NOT NULL AUTO_INCREMENT PRIMARY KEY,
	email VARCHAR(40),
	startDate DATE,
	monthlyFee int,
	endDate VARCHAR(20)

)















